import React from "react";

function Footer() {
  return (
    <div className="container mt-5">
      <div className="row">
        <div className="mx-auto row">
            <h2 className="title">Fancoveo</h2>
            <div className=" ml-4">
                <ul className="row">
                    <li className="ml-2"><small>How Fanconvo Works</small></li>
                    <li className="ml-2"><small>Terms of Use</small></li>
                    <li className="ml-2"><small>Privacy Policy</small></li>
                    <li className="ml-2"><small>Contact Us</small></li>
                </ul>
            </div>


          {/* <div className="row">
            <p className="text-white">Sign up</p>
            <p className="text-white ml-2">Login</p>
          </div> */}
        </div>
      </div>
    </div>
  );
}

export default Footer;
